  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "NodeName" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>NodeName</b> <i>&lt;type&gt;</i> <i>@Annotation1 @Annotation2("value")</i></td></tr><tr><td align="left">Title</td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="attribute1__key" align="left" balign="left">attribute1</td><td port="attribute1__value" align="left" balign="left">value1</td></tr><tr><td port="attribute2__key" align="left" balign="left">attribute2 : number</td><td port="attribute2__value" align="left" balign="left">42</td></tr><tr><td port="nested__key" align="left" balign="left">nested : Array&lt;string&gt;</td><td port="nested__value" align="left" balign="left">[<br>  &quot;a&quot;,<br>  &quot;b&quot;<br>]</td></tr></table></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

